import React from 'react';
import Tree from '../../Assets/tree.png';
import './nav.css';

const Nav = ({ show }) => {
    const handleMission = () => {
        window.location.href = '/#mission';
    }
    const handleObjective = () => {
        window.location.href = '/#objectives';
    }

    return (
        <header>
            <nav className={`nav ${show ? 'visible' : ''}`}>
                <div className="nav-in">
                    <div className="nav-in-one">
                        <div className="nav-in-one-in">
                            <img className="TreeImage" src={Tree} alt="" />
                            <h1>Panchatantra</h1>
                        </div>
                    </div>
                    <div className="nav-in-two">
                        <p onClick={handleMission()} >Our Mission</p>
                        <p onClick={handleObjective()} >What we do?</p>
                        <p>Activities</p>
                        {/* <p>Achievements</p> */}
                        <p>Latest</p>
                        <p onClick={handleAuth()} >Get started</p>
                    </div>
                    {/* <div className="nav-in-three">
                        <button>
                            Donate
                        </button>
                        <button>
                            Join Us
                        </button>
                    </div> */}
                </div>
            </nav>
        </header>
    );
};

export default Nav;
